import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import Sdata from './Sdata';
// console.log(sdata[0].sname);
// function ncard(val){
//     console.log(val);
//  return(
 
// }
ReactDOM.render(
    <>
    
        <h1 className="heading_style">List of top five web series in 2020</h1> 
        
     {/* { Sdata.map(ncard)} */}
     {Sdata.map(function ncard(val){
        <Card 
               imgsrc={val.imgsrc}
               title={val.title}
               sname={val.sname}
               link={val.link}
        />
      }) }
      </> ,document.getElementById("root")
);

//fat arrow function
